import React, { useEffect, useState } from 'react'

function App() {

  const [passwords, setPasswords] = useState([{}]);

  useEffect(() => {
    fetch("/json").then(response => response.json()).then(data => {setPasswords(data)});
    console.log("fetch successful");
  }, []);

  return (
    <div>
      {(typeof passwords.passwords === 'undefined') ? (
        <p>Loading ...</p>
      ) : (
        passwords.passwords.map((password, i) => (
          <p key={i}>{password}</p>
        ))
      )}
    </div>
  )
}

export default App
